  Container: {
    
    justifyContent: 'left'
  },
  image: {
    maxHeight: 920,
    maxWidth: 640,
    
  },
  typography: {
    
  },
    appBarSearch: {
    borderRadius: 4,
    marginBottom: '1rem',
    display: 'flex',
